allow_embedding: false
correct_dependency_ids: {}
db_schema:
  local_code:
    client: none
    columns:
    - admin_ui: {order: 0, width: 200}
      name: file_name
      type: string
    - admin_ui: {order: 1, width: 200}
      name: file
      type: media
    - admin_ui: {order: 2, width: 200}
      name: py_code
      type: media
    server: full
    title: local_code
  users:
    client: none
    columns:
    - admin_ui: {order: 0, width: 200}
      name: email
      type: string
    - admin_ui: {order: 1, width: 200}
      name: enabled
      type: bool
    - admin_ui: {order: 2, width: 200}
      name: last_login
      type: datetime
    - admin_ui: {order: 3, width: 200}
      name: password_hash
      type: string
    - admin_ui: {order: 4, width: 200}
      name: n_password_failures
      type: number
    - admin_ui: {order: 5, width: 200}
      name: confirmed_email
      type: bool
    - admin_ui: {order: 6, width: 200}
      name: itk_path
      type: string
    - admin_ui: {order: 7, width: 200}
      name: microdicom_path
      type: string
    - admin_ui: {order: 10, width: 200}
      name: signed_up
      type: datetime
    - admin_ui: {order: 9, width: 200}
      name: tdslicer_path
      type: string
    server: full
    title: Users
dependencies: []
name: PreProcMedv3
native_deps: null
package_name: PreProcMedv2
runtime_options:
  client_version: '3'
  legacy_features: {__dict__: true, bootstrap3: true, class_names: true, root_container: true}
  server_spec: {base: python310-standard}
  server_version: python3-full
  version: 3
services:
- client_config: {}
  server_config: {}
  source: /runtime/services/tables.yml
- client_config: {allow_signup: true, confirm_email: false, enable_automatically: true, use_email: true}
  server_config: {user_table: users}
  source: /runtime/services/anvil/users.yml
startup: {module: Home_pkg.Home, type: form}
startup_form: null
uplink_visible: true
